import React from "react";
import OwlCarousel from "react-owl-carousel2";
import "./SectionUpcomingEvents.css";

const options = {
  items: 1,
  nav: true,
  rewind: true,
  autoplay: true,
};

class SectionUpcomingEvents extends React.Component {
  render() {
    return (
      <section className="section-upcoming-events">
        <h1>ORGANIZATION SPOTLIGHT</h1>
        <OwlCarousel ref="car" options={options}>
          <div>
            <img src="/img/fullimage1.jpg" alt="The Last of us" />
          </div>
          <div>
            <img src="/img/fullimage2.jpg" alt="GTA V" />
          </div>
          <div>
            <img src="/img/fullimage3.jpg" alt="Mirror Edge" />
          </div>
          <div>
            <img src="/img/fullimage3.jpg" alt="Mirror Edge" />
          </div>
          <div>
            <img src="/img/fullimage3.jpg" alt="Mirror Edge" />
          </div>
          <div>
            <img src="/img/fullimage3.jpg" alt="Mirror Edge" />
          </div>
        </OwlCarousel>
      </section>
    );
  }
}

export default SectionUpcomingEvents;
